import React from 'react'
import Link from 'next/link'
import styled from "styled-components";

const Container = styled.div`
 display: flex;
 flex-direction: column;
 width: 100%;
 margin: 0 auto;
`

const Menu = styled.div`
 display: flex;
 flex-direction: column;
 width: 100%;
 margin: 0 auto;       
`

const List = styled.a``


function Navbar() {
  return (
    <Container>
      <Menu>
        <Link href="/indonesia">
          <List>Indonesia</List>
        </Link>
      </Menu>
      <Menu>
        <Link href="/global">
          <List>Global</List>
        </Link>
      </Menu>
    </Container>
  )
}

export default Navbar;
